INSERT INTO `menu` VALUES (1,'Espresso','<p><strong>A rich and bold espresso shot</strong>, perfect for a quick caffeine boost. Enjoy the intense flavor and aroma that coffee lovers crave.</p>',5,4.00,'Small',1,5,1,5,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(2,'Latte','<p>A creamy latte made with <strong>steamed milk</strong> and a shot of espresso, ideal for a smooth and mellow coffee experience. Perfect for a relaxing break.</p>',5,5.00,'Medium',0,5,2,150,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(3,'Iced Coffee','<p>A chilled coffee with ice, <strong>perfect for hot days</strong> or a refreshing drink any time of the year. Enjoy the crisp and invigorating taste.</p>',6,4.00,'Large',0,5,3,120,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(4,'Strawberry Smoothie','<p>A fresh and delicious smoothie made with ripe strawberries, perfect for a healthy and tasty treat. <strong>Rich in vitamins</strong> and bursting with flavor.</p>',7,5.00,'Large',1,10,4,200,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(5,'Blueberry Muffin','<p>A soft muffin bursting with fresh blueberries, perfect for breakfast or a snack. Enjoy the <strong>warm, comforting taste</strong> of homemade goodness.</p>',9,3.00,'Standard',0,0,5,250,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(6,'Chocolate Cake','<p>A rich chocolate layer cake that is <strong>decadent and moist</strong>. Perfect for chocolate lovers and special occasions.</p>',8,4.00,'Slice',1,15,6,350,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(7,'Vanilla Ice Cream','<p>Creamy vanilla ice cream scoop, <strong>a classic favorite</strong> for all ages. Perfect on its own or with toppings.</p>',10,3.00,'Single Scoop',0,0,7,200,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(8,'Chicken Caesar Salad','<p>Classic Caesar salad with grilled chicken, <strong>fresh romaine lettuce</strong>, and homemade croutons. A healthy and satisfying meal.</p>',12,9.00,'Large',1,10,8,400,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(9,'BLT Sandwich','<p>Bacon, lettuce, and tomato sandwich, <strong>a timeless favorite</strong>. Perfectly balanced with crispy bacon and fresh vegetables.</p>',13,7.00,'Standard',1,5,9,500,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(10,'Spaghetti Bolognese','<p>Spaghetti with rich Bolognese sauce, <strong>a hearty and comforting meal</strong>. Perfect for lunch or dinner.</p>',11,9.00,'Large',1,5,10,600,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(11,'Green Tea','<p>Refreshing green tea, <strong>rich in antioxidants</strong>. Perfect for a calming and healthy drink.</p>',5,3.00,'Medium',1,5,11,0,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(12,'Mocha','<p>Chocolate flavored coffee, <strong>a delightful blend</strong> of coffee and chocolate. Perfect for a sweet and caffeinated treat.</p>',5,5.00,'Medium',1,5,12,200,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(13,'Cappuccino','<p>Espresso with steamed milk and foam, <strong>a classic Italian coffee</strong>. Perfect for a morning boost or an afternoon break.</p>',5,4.00,'Small',1,5,13,120,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(14,'Lemonade','<p>Freshly squeezed lemonade, <strong>perfectly tangy and sweet</strong>. A refreshing drink for any time of the day.</p>',6,3.00,'Large',1,5,14,100,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(15,'Mango Smoothie','<p>Tropical mango smoothie, <strong>full of flavor and nutrients</strong>. Perfect for a refreshing and healthy treat.</p>',7,5.00,'Large',1,10,15,220,0,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(16,'Cheesecake','<p>Creamy cheesecake with graham crust, <strong>rich and indulgent</strong>. Perfect for dessert or a special occasion.</p>',8,5.00,'Slice',1,15,16,300,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0),(17,'Oatmeal Raisin Cookie','<p>Chewy oatmeal cookie with raisins, <strong>a classic treat</strong>. Perfect for a snack or dessert.</p>',9,2.00,'Standard',1,0,17,180,1,'2024-06-07 16:09:00','2024-06-14 20:15:04',0